it('supports axis constraints with zoom', function (done) {
    var centerX;
    var centerY;

    Plotly.newPlot(gd, [{
        type: 'scattergl', x: [1, 15], y: [1, 15]
    }], {
        width: 400,
        height: 400,
        margin: { t: 100, b: 100, l: 100, r: 100 },
