it('@flaky should persist the position of every nodes after drag in attributes nodes.(x|y)', function (done) {
    mockCopy.data[0].arrangement = arrangement;
    var move = [50, -50];
    var nodes;
    var node;
    var x, x1;
    var y, y1;
    var precision = 3;

    Plotly.newPlot(gd, mockCopy)
        .then(function () {
            x = gd._fullData[0].node.x.slice();
            y = gd._fullData[0].node.y.slice();
            expect(x.length).toBe(0);
            expect(y.length).toBe(0);

            nodes = document.getElementsByClassName('sankey-node');
            node = nodes.item(nodeId);
            return drag(node, move[0], move[1]);
        })
        .then(function () {
            x = gd._fullData[0].node.x.slice();
            y = gd._fullData[0].node.y.slice();
            expect(x.length).toBe(mockCopy.data[0].node.label.length);
            expect(y.length).toBe(mockCopy.data[0].node.label.length);

            nodes = document.getElementsByClassName('sankey-node');
            node = nodes.item(nodes.length - 1); // Dragged node is now the last one
            return drag(node, move[0], move[1]);
        })
        .then(function () {
            x1 = gd._fullData[0].node.x.slice();
            y1 = gd._fullData[0].node.y.slice();
            if (arrangement === 'freeform') expect(x1[nodeId]).not.toBeCloseTo(x[nodeId], 2, 'node ' + nodeId + ' has not changed x position');
            expect(y1[nodeId]).not.toBeCloseTo(y[nodeId], precision, 'node ' + nodeId + ' has not changed y position');

            // All nodes should have same x, y values after drag
            for (var i = 0; i < x.length; i++) {
                if (i === nodeId) continue; // except the one was just dragged
                if (arrangement === 'freeform') expect(x1[i]).toBeCloseTo(x[i], 3, 'node ' + i + ' has changed x position');
                expect(y1[i]).toBeCloseTo(y[i], precision, 'node ' + i + ' has changed y position');
            }
            return true;
        })
        .catch(failTest)
        .then(done);
});

describe('Test removal of gl contexts', function () {
    var gd;

    beforeEach(function () {
        gd = createGraphDiv();
    });

    afterEach(function () {
        Plotly.purge(gd);
        destroyGraphDiv();
    });

    it('@gl Plots.cleanPlot should remove gl context from the graph div of a gl2d plot', function (done) {
        Plotly.plot(gd, [{
            type: 'scattergl',
            x: [1, 2, 3],
            y: [2, 1, 3]
        }])
            .then(function () {
                expect(gd._fullLayout._plots.xy._scene).toBeDefined();
                Plots.cleanPlot([], {}, gd._fullData, gd._fullLayout);

                expect(!!gd._fullLayout._plots.xy._scene).toBe(false);
            })
            .catch(failTest)
            .then(done);
    });

    it('@gl Plotly.newPlot should remove gl context from the graph div of a gl2d plot', function (done) {
        var firstGlplotObject, firstGlContext, firstCanvas;

        Plotly.plot(gd, [{
            type: 'scattergl',
            x: [1, 2, 3],
            y: [2, 1, 3]
        }])
            .then(function () {
                firstGlplotObject = gd._fullLayout._plots.xy._scene;
                firstGlContext = firstGlplotObject.scatter2d.gl;
                firstCanvas = firstGlContext.canvas;

                expect(firstGlplotObject).toBeDefined();
                expect(firstGlContext).toBeDefined();
                expect(firstGlContext instanceof WebGLRenderingContext);

                return Plotly.newPlot(gd, [{
                    type: 'scattergl',
                    x: [1, 2, 3],
                    y: [2, 1, 3]
                }], {});
            })
            .then(function () {
                var secondGlplotObject = gd._fullLayout._plots.xy._scene;
                var secondGlContext = secondGlplotObject.scatter2d.gl;
                var secondCanvas = secondGlContext.canvas;

                expect(Object.keys(gd._fullLayout._plots).length === 1);
                expect(secondGlplotObject).not.toBe(firstGlplotObject);
                expect(firstGlplotObject.gl === null);
                expect(secondGlContext instanceof WebGLRenderingContext);
                expect(secondGlContext).not.toBe(firstGlContext);

                expect(
                    firstCanvas.parentNode === null ||
                    firstCanvas !== secondCanvas && firstGlContext.isContextLost()
                );
            })
            .catch(failTest)
            .then(done);
    });
});

